import React from 'react';

const TdZag = ({customClass}) => {
    return (
        <div className="self-stretch  border-zinc-600 flex-col justify-center items-center inline-flex">
            <div className="self-stretch px-3 py-2.5 justify-center items-center inline-flex">
                <div className="grow shrink basis-0 text-center text-white text-xl font-semibold font-['Inter'] leading-none">№
                </div>
            </div>
        </div>
    );
};

export default TdZag;
